    render(){
        return (
        <React.Fragment>
            <Router>

                <Navbar/>
                <Switch>
                    <Route exact path='/' component={articlelist} />
                    <Route path='/article' component={article} />
                </Switch>
            </Router>
        </React.Fragment>
        )
    }
}

export default App;
